import { Fragment } from 'react';
import { useSelector } from 'react-redux';
import Router from 'next/router';
import Header from '../components/Header';
import RedBackdrop from '../components/RedBackdrop';
import styles from '../styles/scss/landing-page.module.scss';

const Index = () => {
	const jwtToken = useSelector((state) => state.jwtToken);

	if (jwtToken !== '') {
		Router.push('/dashboard/home');
	}

	return (
		<Fragment>
			<span className={styles.landingPageContent}>
				<span>
					<Header className={styles.header} />
					<RedBackdrop />
				</span>
				{/* <img
				src={'http://127.0.0.1:8000/storage/sachinkamboj.1@gmail.com/workflow_8/images/hero.jpg'}
				alt={'test'}
			/> */}
				<section className={styles.content}>
					<section className={styles.text}>
						<h1>Never Deal With Annoying Computer Files Ever Again.</h1>
						<h3>
							Youtube Workflow is the easiest tool made to help you store all your necessary files all in
							one place, the Cloud.
						</h3>
					</section>
					<section className={styles.img}>
						{/* <h2>Become An Influencer</h2> */}
						<img src={'images/online-video.svg'} alt="Online" />
					</section>
				</section>
				<section className={styles.highlights}>
					<div className={styles.highlight}>
						<img src={'images/cloud.svg'} alt="Cloud" />
					</div>
					<div className={styles.highlight}>
						<img src={'images/share.svg'} alt="Share" />
					</div>
					<div className={styles.highlight}>
						<img src={'images/workflow.svg'} alt="Workflow" />
					</div>
				</section>
			</span>
		</Fragment>
	);
};

export default Index;
